import './App.css';
import React from 'react';

export default class App extends React.Component {
  render() {
    return (
    <div className="root">

    <Name />

    <Portrait  />
    <Header />

    </div>
    );
  }
}

class Header extends React.Component {
  render(){
    return (
      <div className="header">
        <Tab name="about me"/>
        <Tab name="courses"/>
        <Tab name="projects"/>
      </div>
    );
  }
}

class Tab extends React.Component {
  render() {
    return (
      <div className="Tab">
      <h3>{this.props.name}</h3>
      </div>
    );
  }
}

class Name extends React.Component {
  render(){
    return (
      <div className="name">
         <h1> Emad Siddiq </h1>

      </div>
    );
  }
}

class Portrait extends React.Component{
  render(){
    return(
    <div className="portrait">
      <img src="portrait.jpg" height="400" width="300" alt='me with a grad cap'/>

      </div>
    );
  }
}
